import { HttpClient, HttpErrorResponse } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Emplyoee } from './emplyoee';
import { Observable } from 'rxjs';
mport { catchError } from 'rxjs/operators';
import 'rxjs/add/Observable/error';


@Injectable({
  providedIn: 'root'
})
export class EmplyoeeService {

  private _url : string = "https://m36wk.mocklab.io/getEmplyoee";
  constructor(private http : HttpClient) { }

  getEmplyoees() : Observable<Emplyoee[]>{
    return this.http.get<Emplyoee[]>(this._url)
                    .catchError(this.errorHandler());
  }

  errorHandler(error : HttpErrorResponse){
    return Observable.throw(error.message || "Server Error");


  }
}
